          </Link>
          <Link
            to={linkNext}
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={CatalogListStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
          <Link
            to={linkNext}
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={CatalogListStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
          <Link
            to={linkNext}
            style={{ textDecoration: "none", color: "inherit" }}
          >
            <li className={CatalogListStyles.catalogItem}>
              {" "}
              <CatalogItem />{" "}
            </li>
          </Link>
        </ul>
  );
}

export default CatalogList;
